import 'react-native-gesture-handler';
import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import Profile from './components/Profile/Profile';
import Deck from './components/CardDeck/Deck';
import AddDeckCard from './components/CardDeck/AddDeckCard';

const Tab = createBottomTabNavigator();

const user = {
  username: 'Hally255'
}

export default function App(){
  return (
    <NavigationContainer>
      <Tab.Navigator>
        <Tab.Screen name='Add to Deck List' component={AddDeckCard} />
        <Tab.Screen name='Deck List' component={Deck} initialParams={user} />

        <Tab.Screen name='Profile' component={Profile} />
      </Tab.Navigator>
    </NavigationContainer>
  )
}
